Foreground system: The extrusion process takes cast extrusion billet (round bar stock produced from direct chill molds) and produces extruded shapes. The process begins with an inline preheat that takes the temperature of the billet to a predetermined level depending on the alloy. The billet is then sheared if not already cut to length and deposited into a hydraulic press. The press squeezes the semi-plastic billet through a heated steel die that forms the shape. The shape is extruded into lengths defined by the take-off tables and is either water quenched or air cooled. The shape is then clamped and stretched to form a solid straightened length (AA, 1998).

The straighten lengths are cut to final length multiples and may be placed in an aging furnace to achieve a desired temper. Lengths are then finished (drilled and shaped) and placed into a coating process. The types of coatings include anodized, painted, and lacquered finishes.

This process includes:

- Cradle-to-gate primary ingot production
- Cradle-to-gate secondary ingot production
- Shipment and handling of cast extrusion ingots and billets and auxiliary material;
- Preheating and cutting or shearing of billet lengths;
- Extruding of shapes, cooling, stretching and cutting;
- Heat treating, aging, anodizing or painting;
- Finishing and packaging activities;
- Recovery and handling of internal process scrap;
- Recovery and handling of other by-products of beneficial use;
- Maintenance and repair of plant and equipment; and
- Treatment of process air, liquids, and solids.

Background system: Addressed below (electricity and energy)

Electricity: Electricity is modelled according to the individual country-specific situations. The country-specific modelling is achieved on multiple levels. Firstly, individual energy carrier specific power plants and plants for renewable energy sources are modelled according to the current national electricity grid mix. Modelling the electricity consumption mix includes transmission / distribution losses and the own use by energy producers (own consumption of power plants and "other" own consumption e.g. due to pumped storage hydro power etc.), as well as imported electricity. Secondly, the national emission and efficiency standards of the power plants are modelled as well as the share of electricity plants and combined heat and power plants (CHP). Thirdly, the country-specific energy carrier supply (share of imports and / or domestic supply) including the country-specific energy carrier properties (e.g. element and energy content) are accounted for. Fourthly, the exploration, mining/production, processing and transport processes of the energy carrier supply chains are modelled according to the specific situation of each electricity producing country. The different production and processing techniques (emissions and efficiencies) in the different energy producing countries are considered, e.g. different crude oil production technologies or different flaring rates at the oil platforms.

Thermal energy, process steam: The thermal energy and process steam supply is modelled according to the individual country-specific situation with regard to emission standards and considered energy carriers. The thermal energy and process steam are produced at heat plants. Efficiencies for thermal energy production are by definition 100% in relation to the corresponding energy carrier input. For process steam the efficiency ranges from 85%, 90% to 95%. The energy carriers used for the generation of thermal energy and process steam are modelled according to the specific import situation (see electricity above).

Transports: All relevant and known transport processes are included. Ocean-going and inland ship transport as well as rail, truck and pipeline transport of bulk commodities are considered.

Energy carriers: The energy carriers are modelled according to the specific supply situation (see electricity above).

Refinery products: Diesel fuel, gasoline, technical gases, fuel oils, lubricants and residues such as bitumen are modelled with a parameterised country-specific refinery model. The refinery model represents the current national standard in refining techniques (e.g. emission level, internal energy consumption, etc.) as well as the individual country-specific product output spectrum, which can be quite different from country to country. The supply of crude oil is modelled, again, according to the country-specific situation with the respective properties of the resources.
